import React, { useState, useEffect } from 'react'
import axios from 'axios'



function App() {

  let initialCurrencies = {}


  const [currencies, setCurrencies] = useState(initialCurrencies)


  const getMarketData = () => {
      axios
        .get('https://api.coingecko.com/api/v3/global')
        .then(res => {
        //  console.log(res.data.data)
        const indivCurrencies = res.data.data;
        console.log(indivCurrencies);
        setCurrencies(indivCurrencies)

        }).catch(error => {
          console.log(error);
        });
      }



  return (
    <div >
     <button onClick={getMarketData}>Get Currency Data</button>
     <h1>Active Crypto Currencies : {currencies.active_cryptocurrencies}</h1>
     <h1>Market Cap Change Percentage (24HRS): {currencies.market_cap_change_percentage_24h_usd}</h1>

    </div>
  );
}

export default App;
